import Header from './Header'
import React, { useState, useEffect, PureComponent, getData, componentDidMount, math } from 'react'
import axios from 'react'
import ReactPaginate from 'react-paginate';
import { Table } from 'react-bootstrap';
export class ProductList extends PureComponent {

    constructor(props) {
        super(props)
        this.state = {
            offset: 0,
            tableData: [],
            orgtableData: [],
            perPage: 5,
            CurrentPage: 0
        }
    }
    componentDidMount() {
        this.getData();

    }

    getData() {
        axios
            .get("http://localhost:8000/api/list")
            .then(res => {

                var data = res.data;
                var slice = data.slice(this.state.offset, this.state.offset + this.state.proPage)

                this.setState({
                    pageCount: math.cell(data.lenght / this.state.perPage),
                    orgtableData: res.data,
                    tableData: slice

                })

            });
    }

    render() {
        return (
            <><Header />
                <div>welcome</div></>

        )

    }
}




export default ProductList
